function checkCertID(id, strict) {
    if (id.length != 18) return false;
    var pass;

    var reg = /^[1-9]\d{5}(18|19|[2-9]\d)\d{2}(0[1-9]|1[0-2])(0[1-9]|[1-2][0-9]|30|31)\d{3}[0-9Xx]$/;
    pass = reg.test(id);
    if (!pass) return false;

    var dist = id.substr(0, 6);
    strict ? pass = checkDistrict(dist) : null;
    if (!pass) return false;

    var date = id.substr(6, 8);
    pass = checkDate(date);
    if (!pass) return false;

    var arr = [7, 9, 10, 5, 8, 4, 2, 1, 6, 3, 7, 9, 10, 5, 8, 4, 2];
    var sum = 0;
    for (var i = 0; i < arr.length; i++) sum += parseInt(id.charAt(i)) * arr[i];
    var c = sum % 11;
    var char = ['1', '0', 'X', '9', '8', '7', '6', '5', '4', '3', '2'];
    var code = char[c];
    var last = id.charAt(17);
    last = last == 'x' ? 'X': last;
    return last == code;
}

function checkDate(date) {
    var y = date.substr(0,4), m = date.substr(4,2), d = date.substr(6,2), last;
    y = parseInt(y);
    m = parseInt(m);
    d = parseInt(d);
    if (isNaN(y) || isNaN(y) || isNaN(d) || y * m * d < 0) {
        return false;
    } else if (m < 1 || m > 12) {
        return false;
    } else if (m == 2) {
        last = (((y % 4 == 0 && y % 100 != 0) || y % 400 == 0) ? 29 : 28);
        return d <= last;
    } else {
        last = (((m <= 6 && m % 2 == 0) || (m > 6 && m % 2 == 1)) ? 31 : 30);
        return d <= last;
    }
}

